import Header from "../Header/Header";
import Footer from "../Footer/Footer";

export default function Registration() {
    return (
        <>
            <Header />
            <main className="main">
                <div className="main__registration registration">dvddv </div>
            </main>
            <Footer />
        </>
    );
}
